import React from 'react';
import { Link } from 'react-router-dom';


import '../css/Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-list">
        <li className="navbar-item"><Link to="/" className="navbar-link">Boxer sin costuras</Link></li>
        <li className="navbar-item"><Link to="/acerca" className="navbar-link">Boxer algod√≥n</Link></li>
        <li className="navbar-item"><Link to="/contacto" className="navbar-link">Contacto</Link></li>
        <li className="navbar-item"><Link to="/catalogo" className="navbar-link">Catalogo</Link></li>
        <li className="navbar-item"><Link to="/Confeciones-creacion" className="navbar-link">Hacemos Tu Confeciones</Link></li>
        <li className="navbar-item"><Link to="/login" className="navbar-link">Login</Link></li>
        
      </ul>
    </nav>
  );
};

export default Navbar;
